import React, { Component } from 'react';

class Header extends Component {
    render() {
        return (
            <div>
                <h1>Written by Women</h1>
                <h2>Supporting female tech journalists</h2>
                <h3>Supporting female tech journalists via The Guardian open source API.</h3>
            </div>
        )
    }
}

export default Header;
